import React from 'react';

const ProfilePage = () => {
  return (
    <div>
      <h1>User Profile</h1>
      {/* Placeholder for user profile details */}
      <p>Username: John Doe</p>
      <p>Email: johndoe@example.com</p>
    </div>
  );
};

export default ProfilePage;
